Phaserfroot.PluginManager.register(
  "Comandi_Giocatore_gfbjs",
  class Comandi_Giocatore_gfbjs extends Phaserfroot.Component {
    constructor( target, instanceProperties ) {
      super( {
        name: "Comandi_Giocatore_gfbjs",
        owner: target,
      } );
      this.instanceProperties = instanceProperties;
      this.scene = target.scene;
      this.game = target.scene.game;

      this.owner.once( "levelSwitch", this.destroy, this );

      // Attach custom event listeners.
      this.scene.getKey( 39 ).on( "down", this.onKeyInput39, this );
      this.scene.getKey( 39 ).on( "up", this.onKeyInput392, this );
      this.scene.getKey( 37 ).on( "down", this.onKeyInput37, this );
      this.scene.getKey( 37 ).on( "up", this.onKeyInput372, this );
      this.scene.getKey( 40 ).on( "down", this.onKeyInput40, this );
      this.scene.getKey( 40 ).on( "up", this.onKeyInput402, this );
      this.scene.getKey( 38 ).on( "down", this.onKeyInput38, this );
      this.scene.getKey( 38 ).on( "up", this.onKeyInput382, this );
      this.scene.getKey( 32 ).on( "down", this.onKeyInput32, this );


      // Initialize properties from parameters.


      // Boot phase.
      this.camera = this.scene.cameras.main;
      this.animation_key = this.owner.data.list.animKeyPrefix;
      this.owner.setAnimationListener("animationrepeat", 'attackDown', this._attackDown__22animationrepeat_222, this);

      this.onCreate();

    }

    // BUILT-IN METHODS

    preUpdate () {

    }

    update () {
      this.EVENTS_UPDATE();

    }

    postUpdate () {

    }

    destroy () {
      this.owner.off( "levelSwitch", this.destroy, this );

      // Detach custom event listeners.
      this.scene.getKey( 39 ).off( "down", this.onKeyInput39, this );
      this.scene.getKey( 39 ).off( "up", this.onKeyInput392, this );
      this.scene.getKey( 37 ).off( "down", this.onKeyInput37, this );
      this.scene.getKey( 37 ).off( "up", this.onKeyInput372, this );
      this.scene.getKey( 40 ).off( "down", this.onKeyInput40, this );
      this.scene.getKey( 40 ).off( "up", this.onKeyInput402, this );
      this.scene.getKey( 38 ).off( "down", this.onKeyInput38, this );
      this.scene.getKey( 38 ).off( "up", this.onKeyInput382, this );
      this.scene.getKey( 32 ).off( "down", this.onKeyInput32, this );
      this.owner.setAnimationListener("animationrepeat", 'attackDown', this._attackDown__22animationrepeat_222, this, true);

    }

    // CUSTOM METHODS

    onCreate () {
      // Executed when this script is initially created.
      this.owner.tags.add( 'player' );
    }

    onKeyInput39 () {
      this.owner.body.velocity.x = 200;
    }

    onKeyInput392 () {
      this.owner.body.velocity.x = 0;
    }

    onKeyInput37 () {
      this.owner.body.velocity.x = (-200);
    }

    onKeyInput372 () {
      this.owner.body.velocity.x = 0;
    }

    onKeyInput40 () {
      this.owner.body.velocity.y = 200;
    }

    onKeyInput402 () {
      this.owner.body.velocity.y = 0;
    }

    onKeyInput38 () {
      this.owner.body.velocity.y = (-200);
    }

    onKeyInput382 () {
      this.owner.body.velocity.y = 0;
    }

    EVENTS_UPDATE () {
      // Executed every frame.
      this.camera.centerOn( this.owner.x, this.owner.y );
    }

    onKeyInput32 () {
      // Animazione dell'attacco e dire agli oggetti che stiamo attaccando
      this.owner.playMy( 'attackDown' );
      this.scene.broadcast( 'player attack' );
    }

    _attackDown__22animationrepeat_222 () {
        this.owner.playMy( 'walkDown' );

    }

  }
);

